// import "./customButton.styles.scss";
import { CustomButtonContainer } from "./customButton.styles";

const CustomButton = ({ children, ...otherProps }) => {
  return (
    <button
      className={`${isGoogleSignIn ? "custom-button--blue" : ""} ${
        inverted ? "inverted" : ""
      } custom-button`}
      {...otherProps}
    >
      {children}
    </button>
  );
};

export default CustomButton;

